import { login, logout } from './login';
import { addData } from './addData';
import { editUserData } from './editUserData';
import { deleteUserData } from './deleteUserData ';

import { addProject } from './addProject';
import { editProjectData } from './editProjectData';
import { deleteProjectData } from './deleteProjectData';

import { showAlert } from './alert';

// LOGIN 
$(document).on('submit', '#form', function (e) {
  e.preventDefault();
  let username = $(this).find('input[name=username]').val();
  let password = $(this).find('input[name=password]').val();
  login(username, password);
});

// LOGOUT
$(document).on('click', logout());

// ================================================== User ==================================================

// ADD USER
$(document).on('submit', '#add_form', function (e) {
  e.preventDefault();
  let name = $(this).find('input[name=name]').val();
  let username = $(this).find('input[name=username]').val();
  let password = $(this).find('input[name=password]').val();
  let email = $(this).find('input[name=email]').val();
  let phone = $(this).find('input[name=phone]').val();
  let address = $(this).find('input[name=address]').val();
  // console.log(name, username, password, email, phone, address);
  addData(name, username, password, email, phone, address);
});

// EDIT USER
$(document).on('submit', '#update_user', function (e) {
  e.preventDefault();
  let id = $(this).data('id');
  let name = $(this).find('input[name=name]').val();
  let username = $(this).find('input[name=username]').val();
  let password = $(this).find('input[name=password]').val();
  let email = $(this).find('input[name=email]').val();
  let phone = $(this).find('input[name=phone]').val();
  let address = $(this).find('input[name=address]').val();
  // console.log(id,name, username, password, email, phone, address);
  editUserData(id,name, username, password, email, phone, address);
});


// Delete User
$(document).on('click', '#delete_user', function (e) {
  e.preventDefault();
    let id = $(this).data('id');
    // console.log('id',id);
    deleteUserData(id);
});

// ================================================== Project ==================================================

// ADD Project
$(document).on('submit', '#project_form', function (e) {
  e.preventDefault();
  let projectName = $(this).find('input[name=projectName]').val();
  let description = $(this).find('input[name=description]').val();
  let startDates = $(this).find('input[name=startDates]').val();
  let endDates = $(this).find('input[name=endDates]').val();
  let username = $(this).find('input[name=username]').val();
  let notes = $(this).find('input[name=notes]').val();
  // console.log(projectName, description, startDates, endDates, username, notes);
  addProject(projectName, description, startDates, endDates, username, notes);
});

// EDIT Project
$(document).on('submit', '#update_project', function (e) {
  e.preventDefault();
  let id = $(this).data('id');
  let projectName = $(this).find('input[name=projectName]').val();
  let description = $(this).find('input[name=description]').val();
  let startDates = $(this).find('input[name=startDates]').val();
  let endDates = $(this).find('input[name=endDates]').val();
  let username = $(this).find('input[name=username]').val();
  let notes = $(this).find('input[name=notes]').val();
  // console.log(id,projectName, description, startDates, endDates, username, notes);
  editProjectData(id,projectName, description, startDates, endDates, username, notes);
});

// Delete Project
$(document).on('click', '#delete_project', function (e) {
  e.preventDefault();
    let id = $(this).data('id');
    // console.log('id',id);
    deleteProjectData(id);
});
